if (!items || items.length === 0) {
    throw new Error("No input data found.");
}

const trackStatuses = ["Current", "Vacant-Rented", "Vacant-Unrented", "Evict"];
const today = new Date();
const currentMonth = today.getMonth(); 
const currentYear = today.getFullYear();
const nextMonth = (currentMonth + 1) % 12;
const nextYear = currentMonth === 11 ? currentYear + 1 : currentYear;
const followingMonth = (currentMonth + 2) % 12;
const followingYear = currentMonth >= 10 ? currentYear + 1 : currentYear;

const propertyData = {};

// Converts Excel serial numbers to JS Date
function excelDateToJSDate(excelDate) {
    const base = new Date(Date.UTC(1899, 11, 30));
    return new Date(base.getTime() + excelDate * 86400000);
}

// Tries to parse a lease date, whether ISO string, MM/DD/YYYY, or Excel number
function parseLeaseDate(value) {
    if (!value) return null;

    if (typeof value === 'number') {
        return excelDateToJSDate(value);
    }

    if (typeof value === 'string') {
        if (!isNaN(Date.parse(value))) {
            return new Date(value);
        }

        const parts = value.split("/");
        if (parts.length === 3) {
            const [month, day, year] = parts.map(p => parseInt(p, 10));
            if (!isNaN(month) && !isNaN(day) && !isNaN(year)) {
                return new Date(year, month - 1, day);
            }
        }
    }

    return null;
}

items.forEach(item => {
    const json = item.json;

    const propertyID = json["Property ID"];
    const propertyName = json["Property Name"];
    const unit = json["Unit"];
    const status = json["Status"];
    const leaseToRaw = json["Lease To"];
    const leaseExpiresMonth = json["Lease Expires Month"];

    if (!propertyID || !unit) return;

    if (!propertyData[propertyID]) {
        propertyData[propertyID] = {
            "Property Name": propertyName,
            "Status Counts": {},
            "Units By Status": {},
            "Lease Expirations": {
                "30 Days": 0,
                "60 Days": 0,
                "90 Days": 0,
                "Month-To-Month": 0
            }
        };
    }

    const prop = propertyData[propertyID];

    if (trackStatuses.includes(status)) {
        if (!prop["Status Counts"][status]) {
            prop["Status Counts"][status] = 0;
            prop["Units By Status"][status] = [];
        }
        prop["Status Counts"][status]++;
        prop["Units By Status"][status].push(unit);
    }

    if (
        leaseExpiresMonth &&
        leaseExpiresMonth.toLowerCase().includes("month-to-month")
    ) {
        prop["Lease Expirations"]["Month-To-Month"]++;
    }

    const leaseDate = parseLeaseDate(leaseToRaw);
    if (leaseDate instanceof Date && !isNaN(leaseDate)) {
        const leaseMonth = leaseDate.getMonth();
        const leaseYear = leaseDate.getFullYear();

        if (leaseMonth === currentMonth && leaseYear === currentYear) {
            prop["Lease Expirations"]["30 Days"]++;
        } else if (leaseMonth === nextMonth && leaseYear === nextYear) {
            prop["Lease Expirations"]["60 Days"]++;
        } else if (leaseMonth === followingMonth && leaseYear === followingYear) {
            prop["Lease Expirations"]["90 Days"]++;
        }
    }
});

const formatted = Object.entries(propertyData).map(([propertyID, data]) => ({
    "Property ID": propertyID,
    "Property Name": data["Property Name"],
    "Status Counts": data["Status Counts"],
    "Units By Status": data["Units By Status"],
    "Lease Expirations": data["Lease Expirations"]
}));

return [{ json: { propertyData: formatted } }];

// Ensure input data is available
if (!items || items.length === 0 || !items[0].json.propertyData) {
    throw new Error("No property data found.");
}

// Extract the propertyData array
const properties = items[0].json.propertyData;

// Convert each property object into an individual item
const output = properties.map(property => {
    const currentUnits = property["Units By Status"]["Current"] || [];
    const vacantUnrentedUnits = property["Units By Status"]["Vacant-Unrented"] || [];
    const vacantRentedUnits = property["Units By Status"]["Vacant-Rented"] || [];
    const evictUnits = property["Units By Status"]["Evict"] || [];
    const noticeRentedUnits = property["Units By Status"]["Notice Rented"] || [];
    const noticeUnrentedUnits = property["Units By Status"]["Notice-Unrented"] || [];

    const statusCounts = property["Status Counts"] || {};
    const leaseExpirations = property["Lease Expirations"] || {};

    return {
        json: {
            "Property ID": property["Property ID"],
            "Property Name": property["Property Name"],

            // Status Counts
            "Current Count": statusCounts["Current"] || 0,
            "Vacant-Rented Count": statusCounts["Vacant-Rented"] || 0,
            "Vacant-Unrented Count": statusCounts["Vacant-Unrented"] || 0,
            "Notice-Rented Count": statusCounts["Notice Rented"] || 0,
            "Notice-Unrented Count": statusCounts["Notice-Unrented"] || 0,
            "Notice-Eviction Count": statusCounts["Evict"] || 0,

            // Unit Lists
            "Current": currentUnits.join(", "),
            "Vacant-Rented": vacantRentedUnits.join(", "),
            "Vacant-Unrented": vacantUnrentedUnits.join(", "),
            "Notice-Rented": noticeRentedUnits.join(", "),
            "Notice-Unrented": noticeUnrentedUnits.join(", "),
            "Notice-Eviction": evictUnits.join(", "),

            // Lease Expiration Counts
            "Lease Expiring in 30 Days": leaseExpirations["30 Days"] || 0,
            "Lease Expiring in 60 Days": leaseExpirations["60 Days"] || 0,
            "Lease Expiring in 90 Days": leaseExpirations["90 Days"] || 0,
            "Lease Month-To-Month": leaseExpirations["Month-To-Month"] || 0
        }
    };
});

// Return the processed data for n8n
return output;
